import { Input, FormBtn } from "../../components/Forms";
import Container from "../../components/Container";


class Profile extends Component {

    render(){
        return(
            <Container fluid>
                <div className="profile-container">Hello</div>
            </Container>
        )
    }


}


export default Profile;
